import React, { useEffect, useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { getRecipes, setSelectedDietType } from '../../redux/actions';
import Cards from '../Cards/Cards'; // Importar Cards en lugar de Card
import styles from './HomePage.module.css';
import Pagination from '../Pagination/Pagination';



const HomePage = () => {

  //cuando se monta (useEffect(majenamos el ciclo de vida )), que haga el dispatch(useDistpatch) para
  const dispatch = useDispatch();
  
  useEffect(()=> {
    dispatch(getRecipes())
  },[dispatch])

  return (
    <div className={styles.homeContainer}>
        
        <h1>HOME PAGE:</h1>
        <h2>Aqui deben ir botones de filtro, de ordenamiento y de crear receta</h2>
        
        <Pagination/>
        <Cards />
        <Pagination/>
    </div>
  )
}

export default HomePage
